const lName = 'Fingert';
const date = new Date();

const img = 'https://picsum.photos/200';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div className="App">
    <h1 className="header" contentEditable="true" spellCheck="false">
      Created by {fName} {lName}
